measurements.description:
One flower on one 33-cm staked inflorescence; dorsal sepal white centrally overlaid chartreuse, veined medium green;
   synsepal light green overlaid distinctive green veins;
   petals superior half amber, inferior half light green, light veining throughout, stippled burgundy centrally;
   full pouch amber, light blush overlaid; 
   staminode light amber;  
   substance firm; texture glossy; slight cupping precluded higher score.
